const AddTask = () => {
  return (
    <form>
      <div className="add-form">
        <label>Task</label>
        <input type="text" placeholder="Add Task" />
      </div>
      <div className="form-control form-control-check">
        <label>Day</label>
        <input type="text" placeholder="Add Day" />
      </div>
      <div className="form-control form-control-check">
        <label>Reminder</label>
        <input type="checkbox" />
      </div>
    </form>
  );
};

export default AddTask;
